    "body": "It would be good to move the project over to a maven build. This will give us:\n\n* versioned jars\n* a path to publishing these versioned jars, together with documentation\n* proper management of dependencies\n* the possibility of managing several jars as deliverables, so that extensions can have a life-cycle that isn't tied 1:1 with the core codebase\n\nTo achieve this we need to\n\n* write a pom.xml\n* adjust the directory structure to the maven default\n* optionally, adjust the build.xml script to use the new directory structure"
