    "body": "The spec uses http://sbols.org/v1# as the prefix for core vocabulary terms. It states in various places that sbols.org is a shorthand for sbolstandard.org. Does this imply that we should be able to use http://sbols.org/v1# and http://sbolstandard.org/v1# interchangeably? Or are we required to use exactly and exclusively http://sbols.org/v1#?\r\n\r\nPersonally, I would prefer to do away with sbols.org entirely in the spec and as a preferred prefix, and use only sbolstandard.org. However, there may be historical reasons, beyond typing fatigue (easily avoided by machine-generation or prefixes) for the short form. I don't see allowing a choice as a viable option though - we would no longer always be able to decide if two URIs are the same just by looking at them."
