    "pull_request": {
      "html_url": null,
      "diff_url": null,
      "patch_url": null
    },
    "body": "The spec for Collection.components states:\r\n\r\ncomponents: (optional)\r\nZero or more instances of type DnaComponent which are members of this Collection\r\nand represent DNA segments for engineering biological systems.\r\n\r\nIn the Java representation, this makes it legal to return null and also return an empty collection for the accessor of components. Are we gaining anything by allowing this to be optional?\r\n\r\nMy feeling is that the spec should be as implementation agnostic as possible. So, if we are allowing this to be both optional and zero or more, then we need to describe in the spec the intended semantics of an absent value as distinct from a present but empty value. However, unless there's a compelling reason for this complexity, I'd prefer to simply drop the optional attribute entirely.\r\n\r\nThe same issue arises with SequenceAnnotation.precedes and DnaComponent.annotations. Each of these currently return optional collections.\r\n\r\nI'd like to hear from other implementers if they use the absent vs present and empty distinction to encode any useful information. If you do, then perhaps there's an argument for keeping this or providing a more robust mechanism for capturing that knowledge."
